#include "common.h"
using namespace std;

namespace shortestSubarray {
/*
// TODO: copy problem statement here
 862. Shortest Subarray with Sum at Least K
 Hard
 
 485
 
 13
 
 Favorite
 
 Share
 Return the length of the shortest, non-empty, contiguous subarray of A with sum at least K.
 
 If there is no non-empty subarray with sum at least K, return -1.
 
 
 
 Example 1:
 
 Input: A = [1], K = 1
 Output: 1
 Example 2:
 
 Input: A = [1,2], K = 4
 Output: -1
 Example 3:
 
 Input: A = [2,-1,2], K = 3
 Output: 3
 
 
 Note:
 
 1 <= A.length <= 50000
 -10 ^ 5 <= A[i] <= 10 ^ 5
 1 <= K <= 10 ^ 9
 */

class Solution {
public:
    int shortestSubarray2_wrong(vector<int>& A, int K) {
        int n = A.size(), l = 0, r = 0, k = 0, res = INT_MAX;
        while (r < n) {
            k += A[r++];
            while (k >= K) {
                res = min(res, r-l);
                k -= A[l++];
            }
        }
        return res == INT_MAX ? -1 : res;
    }
    /**
     * https://leetcode.com/problems/shortest-subarray-with-sum-at-least-k/discuss/204290/Monotonic-Queue-Summary
     */
    int shortestSubarray(vector<int>& A, int K) {
        int n = A.size();
        vector<int> sum(n+1, 0);
        for (int i = 0; i < n; ++i) {
            sum[i+1] = sum[i] + A[i];
        }
        
        int res = INT_MAX;
        deque<int> mnq;
        for (int i = 0; i < n + 1; ++i) {
            // any element > sum[i] would be useless, and sum[i]
            // would be a better start point to later subarrays.
            while (mnq.size() && sum[mnq.back()] >= sum[i]) {
                mnq.pop_back();
            }
            
            // any element <= sum[i] - K would be good for sum[i] to
            // compose a subarray, but no better for element sum[j] (j > i)
            // as the length would be larger that of sum[i].
            while (mnq.size() && sum[mnq.front()] <= sum[i] - K) {
                res = min(res, i - mnq.front());
                mnq.pop_front();
            }
            
            mnq.push_back(i);
        }
        return res == INT_MAX ? -1 : res;
    }
    /**
     * using two pointers, left and right.
     * when moving left pointer, reset right if a negative element
     * is encountered.
     *
     * Time limit exceeded, when encountering array like this:
     * pos, neg, pos, neg, as having to sum again for every positive position,
     */
    int shortestSubarray_TLE(vector<int>& A, int K) {
        int n = A.size();
        int res = INT_MAX;
        int maxSum = A[0];
        int maxIdx = 0;
        for (int i = 0; i < n; ++i) {
            if (A[i] >= K) {
                return 1;
            }
            if (A[i] < 0) { // how to optimize?
                maxSum = 0;
                maxIdx = i;
                continue;
            }
            
            int j = maxIdx + 1;
            int cs = maxSum;
            while (j < n && cs < K) {
                cs += A[j];
                if (cs > maxSum) {
                    maxSum = cs;
                    maxIdx = j;
                }
                ++j;
            }
            if (cs >= K && j - i < res) {
                res = j - i;
            }
            maxSum -= A[i];
        }
        if (res == INT_MAX) {
            return -1;
        }
        return res;
    }
    /**
     * using two pointers, left and right.
     * left will point to each positive element, and right will
     * point to the element that makes the largest subarray sum or
     * the right end of a subarray that satifies the requirement.
     *
     * Note, for some element left points to, there is no subarray
     * satifying the requirement.
     */
    int shortestSubarray_wrong2(vector<int>& A, int K) {
        int n = A.size();
        int res = INT_MAX;
        int maxSum = A[0];
        int maxIdx = 0;
        for (int i = 0; i < n; ++i) {
            if (A[i] >= K) {
                return 1;
            }
            if (A[i] < 0) {
                maxSum -= A[i];
                continue;
            }
            int j = maxIdx + 1;
            int cs = maxSum;
            while (j < n && cs < K) {
                cs += A[j];
                if (cs > maxSum) {
                    maxSum = cs;
                    maxIdx = j;
                }
                ++j;
            }
            
            if (cs >= K) {
                --j;
                while (j >= i && (cs >= K || A[j] <= 0)) {
                    cs -= A[j];
                    --j;
                }
                maxSum = cs + A[++j]; // maxSum > K may not hold.
                maxIdx = j;
                if (j - i + 1 < res) {
                    res = j - i + 1;
                }
            }
            maxSum -= A[i];
        }
        if (res == INT_MAX) {
            return -1;
        }
        return res;
    }
    /**
     * using two pointers, left and right.
     * left = starting index of an subarray
     * right = the end index of an subarray has sum at least K.
     *
     * Move left one by one to find the length of each subarray starting
     * at each index.
     *
     * For each left position, find right index. Note, right index only
     * moves rightward, so this is O(n).
     *
     *
     * When previous elements are negative, then right pointer might move too
     * far right, thus cause missing result...
     * an example is, {{-28,81,-20,28,-29},89}.
     */
    int shortestSubarray_wrong(vector<int>& A, int K) {
        int n = A.size();
        int res = INT_MAX;
        int j = 0;
        int cs = 0;
        for (int i = 0; i < n; ++i) {
            while (j < n && cs < K) {
                cs += A[j++];
            }
            if (j == i) {
                cs += A[j++];
            }
            if (cs >= K && j - i < res) {
                res = j - i;
            }
            cs -= A[i];
        }
        if (res == INT_MAX) {
            return -1;
        }
        return res;
    }

private:
};

}

